import { Producto } from "../models/Producto";
import { ARREGLO_CATEGORIA } from "./Categoria-moks";

export const ARREGLO_PRODUCTO: Array<Producto> =[
    new Producto(1, ARREGLO_CATEGORIA[0], "Fresas", "Lorem ipsum dolor sit amet consectetur adipiscing elit, potenti ante erat faucibus nunc magnis metus bibendum, fermentum viverra diam ut curae vel.", 20 , 2000.00, new Date("2020/03/20"),"tostacos.png", "data:image/webp;base64,"),
    new Producto(2, ARREGLO_CATEGORIA[1], "Lechuga","Lorem ipsum dolor sit amet consectetur adipiscing elit, potenti ante erat faucibus nunc magnis metus bibendum, fermentum viverra diam ut curae vel.", 32, 3600.00, new Date("2022/11/15"),"COCA.png", "data:image/jpeg;base64,"),
    new Producto(3, ARREGLO_CATEGORIA[2], "Cilantro","Lorem ipsum dolor sit amet consectetur adipiscing elit, potenti ante erat faucibus nunc magnis metus bibendum, fermentum viverra diam ut curae vel.", 55, 3600.00, new Date("2023/11/15"),"COCA.png", "data:image/jpeg;base64,"),
    new Producto(4, ARREGLO_CATEGORIA[3], "frijoles", "Lorem ipsum dolor sit amet consectetur adipiscing elit, potenti ante erat faucibus nunc magnis metus bibendum, fermentum viverra diam ut curae vel.", 17 , 2000.00, new Date("2024/03/20"),"tostacos.png", "data:image/jpeg;base64,"),
    new Producto(5, ARREGLO_CATEGORIA[4], "Almendras", "Lorem ipsum dolor sit amet consectetur adipiscing elit, potenti ante erat faucibus nunc magnis metus bibendum, fermentum viverra diam ut curae vel.", 43 , 2000.00, new Date("2025/03/20"),"tostacos.png", "data:image/jpeg;base64,"),
    new Producto(6, ARREGLO_CATEGORIA[5], "Miel", "Lorem ipsum dolor sit amet consectetur adipiscing elit, potenti ante erat faucibus nunc magnis metus bibendum, fermentum viverra diam ut curae vel.", 34 , 2000.00, new Date("2025/05/20"),"tostacos.png", "data:image/jpeg;base64,"),
];
